member.summary:
根据交易订单获取线上发货物流服务列表，线上发货物流服务仅能用于线上发货，请了解！
以下包裹信息是不支持线上发货的，获取方案可能为空：
1、长\宽\高  加起来 不能大于90;
2、长宽高最大的一条边不能大于60cm;
3、包裹重量不能超过2KG;
4、已操作线下物流发货的订单。

上架一个或者多个商品，待上架的产品ID通过参数productIds指定，产品ID之间使用英文分号(;)隔开, 最多一次只能上架50个商品。
行业准入商品上架限制 如果用户退出了一个行业准入的类目(比如：假发)，那么将无法上架这个类目下的商品。
返回值 1. 接口调用成功后，将返回类似的json串: {"modifyCount": 10, success: true}。 2. 接口调用失败后，将返回类似的json串: {"error_code": "11001023", "error_message": "Product too much", "exception": "exception message"}

